import org.apache.spark.sql.catalyst.expressions._
import org.apache.spark.sql.Row
import java.math.BigDecimal

object GradientDescenttt {

  /** Steepest descent method modifying input values*/
  def steepestDescent(x : Array[Double], learningRate : Double, tolerance : Double, fPL: List[(String,String,String)], fDL: List[(String,String,String)] ) = {
    val n = x.size
    var h = tolerance
    var alpha = learningRate
    var g0 = g(x,fPL) // Initial estimate of result.

    // Calculate initial gradient.
    var fi = gradG(x,h,fPL,fDL)
    // Calculate initial norm.
    var delG = 0.0
    for (i <- 0 until n by 1)  delG += fi(i) * fi(i)
    delG = math.sqrt(delG)
//    println("delG: " + delG)
    var b = alpha / delG

    // Iterate until value is <= tolerance.
    var counter = 0
    while(delG > tolerance){
//      while (counter < 100) {
      // Calculate next value.
      for (i <- 0 until n by 1) x(i) -= b * fi(i)
      h /= 2

      // Calculate next gradient.
      fi = gradG(x,h,fPL,fDL)
  //    println("Next gradient: "+ fi(0))
      // Calculate next norm.
      delG = 0.0
      for (i <- 0 until n by 1) delG += fi(i) * fi(i)
      delG = math.sqrt(delG)
    //  println("delG: " + delG)
      b = alpha / delG
//      b = 1 / delG 
      // Calculate next value.
      var g1 = g(x,fPL)

      // Adjust parameter.
      if(g1 > g0) alpha = alpha / 2
      else g0 = g1
      counter = counter +1
    }
  }  //  End of SteepestDescent method            

  /** Gradient of the input function given in the task*/
  def gradG(x : Array[Double], h : Double, fPL: List[(String,String,String)], fDL: List[(String,String,String)]) : Array[Double] = {
    val n = x.size
    val z : Array[Double] = Array.fill(n){0}
    val y = x
    val g0 = g(x,fPL)
    for(i <- 0 until n by 1){
     // y(i) += h
     // z(i) = (g(y) - g0) / h
      z(i) = gDerivative(y,fDL) 
    }
    z
  }

  /** derivative of g */

  def gDerivative( x : Array[Double], fDL: List[(String,String,String)]   ) : Double = {

     val zero = new BigDecimal("0")
     var result = new BigDecimal("0")
     val argument = new BigDecimal(x(0))
     for (terms <- fDL)
     {
       val deg = (terms._1).toInt match {    //  edge condition from DifferentiateUDF
           case -1 => 0
           case _    => (terms._1).toInt
       }
       val s= new BigDecimal(terms._2)
       val div= new BigDecimal(terms._3)
       result=result.add(argument.pow(deg).multiply(s.divide(div)))

     }
  //   println("derivative result: " + result.toString)
     result.doubleValue()

  }

   /** Bivariate function given in the task*/  // testing with free variable = 8
  def g( x : Array[Double], fPL: List[(String,String,String)]) : Double = {

     val zero = new BigDecimal("0")
     var result = new BigDecimal("0")
     val argument = new BigDecimal(x(0))
     for (terms <- fPL)
     {
       val deg = (terms._1).toInt match {
           case -1 => 0
           case _    => (terms._1).toInt
       }
       val s= new BigDecimal(terms._2)
       val div= new BigDecimal(terms._3)
       result=result.add(argument.pow(deg).multiply(s.divide(div)))

     }
 //    println("g() result: " + result.toString)
     result.doubleValue()
  }


  def main(args: Array[String]): Unit = {
    val tolerance = 0.0001
